DROP DATABASE IF EXISTS stories;

CREATE DATABASE stories;

\c stories;


CREATE TABLE users (
    id SERIAL PRIMARY KEY,
    username VARCHAR NOT NULL UNIQUE,
    password VARCHAR NOT NULL,
    region VARCHAR,
    info VARCHAR,
    email VARCHAR,
    avatar VARCHAR
    
);

CREATE TABLE questions (
    id SERIAL PRIMARY KEY,
    starter VARCHAR
);

CREATE TABLE posts (
    id SERIAL PRIMARY KEY,
    first_question INT REFERENCES questions(id),
    p_username VARCHAR NOT NULL REFERENCES users(username),
    file_src VARCHAR,
    story_title VARCHAR NOT NULL,
    caption VARCHAR
);

CREATE TABLE user_questions (
    id SERIAL PRIMARY KEY,
    story_id INT NOT NULL REFERENCES posts(id),
    new_question VARCHAR NOT NULL,
    user_name VARCHAR,
    user_email VARCHAR,
    user_region VARCHAR,
    suggested_story VARCHAR,
    followup_answer VARCHAR
);

-- CREATE TABLE followup_questions (
--     id SERIAL PRIMARY KEY,
--     user_question_id INT NOT NULL REFERENCES user_questions(id),
--     followup_answer VARCHAR
-- );

CREATE TABLE likes(
    id SERIAL PRIMARY KEY,
    post_id INT REFERENCES posts(id),
    liker_name VARCHAR REFERENCES users(username)
);

CREATE TABLE comments (
    id SERIAL PRIMARY KEY,
    commentors_name VARCHAR REFERENCES users(username),
    comment VARCHAR,
    c_post_id INT REFERENCES posts(id)
);

CREATE TABLE tags (
   id SERIAL PRIMARY KEY,
   tag_name VARCHAR UNIQUE
);

CREATE TABLE post_tag (
   id SERIAL PRIMARY KEY,
   tag_id INT REFERENCES tags(id),
   ptag_id INT REFERENCES posts(id)
);

