INSERT INTO questions (starter)
    VALUES
        ('Can you tell me about a person who has been kindest to you in your life?'),
        ('What are some of the most important lessons you have learned in life?'),
        ('For future generations of your family listening to this years from now, is there an wisdom you would want to pass on to them? What would you want them to know'),
        ('Do you remember any songs that you used to sing? Can you sing them now?'),
        ('Can you describe the moment when you saw your child for the first time?');


INSERT INTO posts (first_question, p_username, file_src, story_title, caption)
    VALUES
        ( 4, 'GroupSix', 'https://images.unsplash.com/photo-1591198159138-1db2fd6f0fe1?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1049&q=80', 'That One Time', 'Moving to the US wasnt as much of a cultural shock as people say. The language was the same, crowd interactions the same, currency was almost equal to what I had back home with no insane conversion rates involved. There were a few things that stood out, everything was just so HUGE! The stores, 4 - 6 lane roads instead of 2, and so many different kinds of food. The other one was how divided people seem to be. Even in such a big city, people typically only interacted with the ones that looked like them. As a new user, I want to know of the experience others had moving to the US, so that I may not feel so overwhelmed with the way of life in a developed country.'),
        ( 2, 'GroupSix', 'https://images.unsplash.com/photo-1591199740317-f79118f08faf?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=800&q=60', 'That One Time', 'My name is CuriousSalt, I want to learn more about people so that I can satisfy my people watching hobby. I keep to myself normally but I do love to hear stories about random strangers I do not know. I found this awesome site with stories about people from all over the world. The best part is I can start reading and watching these stories right away without making an account and the stories are engaging because other people are interviewing the storyteller.'),
        ( 5, 'GroupSix', 'https://images.unsplash.com/photo-1591174906688-b9b7f18ca7fe?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=967&q=80', 'That One Time', 'My name is PillowMonster, and I found this great site where I can tell people what its like to be a Professional Mourner. Its crazy all the things I heard and experienced when I get hired for this gig. The people are never what you expect!'),
        ( 1, 'GroupSix', 'https://images.unsplash.com/photo-1591155654683-09555b9e1362?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=967&q=80', 'That One Time', 'Hi, my name is Jo, I am an aspiring traveler. The country I am interested in visiting recently is Turkey. The reason I am interested in Turkey is because it was once known as the Ottoman Empire so it has a rich history and a lot of historical cities and sites. One of the most interesting sites is called the Grand Bazaar in Istanbul. I want to know what to expect from the country and its people. It would also be nice to know a few key words to communicate with the locals.'),
        ( 2, 'GroupSix', 'https://images.unsplash.com/photo-1591119463134-1bd5ec0c5dbf?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1467&q=80', 'That One Time', 'Gaming in Asia has been a lifestyle. The culture around it was different. Hotels and gaming cafes with blazing fast internet, powerful PCs, lounge and rest areas, and finally cafeterias.'),
